#define MDNIE_CMD_LW(cmd, last, delay) 	\
{									\
	.msg.channel = 0,				\
	.msg.type = MIPI_DSI_DCS_LONG_WRITE,	\
	.msg.flags = 0,					\
	.msg.ctrl = 0,					\
	.msg.wait_ms = 0,				\
	.msg.tx_len = sizeof(cmd),		\
	.msg.tx_buf = cmd,				\
	.msg.rx_len = 0,				\
	.msg.rx_buf = NULL,				\
	.last_command = last,			\
	.post_wait_ms = delay,			\
	.ctrl = 0, 						\
	.ctrl_flags = 0,				\
	.ss_txbuf = cmd					\
}

#define MDNIE_CMDS_SET(name)            \
    static struct dsi_cmd_desc name[] = {	\
        MDNIE_CMD_LW(level_0_key_on, false, 0),	\
        MDNIE_CMD_LW(level_1_key_on, false, 0),	\
        MDNIE_CMD_LW(multi_cmd_enable, false, 0),	\
        MDNIE_CMD_LW(multi_cmd_dummy,  false, 0),	\
        MDNIE_CMD_LW(name ## _1, false, 0),	\
        MDNIE_CMD_LW(name ## _2, false, 0),	\
        MDNIE_CMD_LW(name ## _3, false, 0),	\
        MDNIE_CMD_LW(name ## _4, false, 1),	\
        MDNIE_CMD_LW(multi_cmd_disable, false, 20),	\
        MDNIE_CMD_LW(multi_cmd_dummy,  false, 0),	\
        MDNIE_CMD_LW(level_1_key_off, true, 0),    \
        MDNIE_CMD_LW(level_0_key_off, true, 0),    \
    };

